import { Link } from 'react-router-dom';
import "../Styles/Navbar.css"
export default function Navbar(){
    return (
        <div className='header'>
            <p>wholesaler</p>
        <div className="navbar">
            
             <Link to="/">Home</Link>
             <Link to="/profile">Profile</Link>
             <Link to="/dashboard">Dashboard</Link>
        </div>
        </div>
    )
}
